import { Box,Stack } from '@mui/material'

function App() {
  return (
    <Stack direction={'row'}  sx={{ background: 'tomato' }}>
      <Box flex={2} sx={{ background: 'tomato' }}>Box1</Box>
      <Box flex={5} sx={{ background: 'blue' }}>Box2</Box>
      <Box flex={2} sx={{ background: 'red' }}>Box3</Box>
    </Stack>
  );
}

export default App;
